import React from 'react';
import styled from 'styled-components';

//Styles
const Container = styled.div`
  width: 20rem;
  height: 22rem;
  border: 1px solid;
  border-radius: 8px;
`;

const Image = styled.div`
  width: 20rem;
  height: 18rem;
  background-color: red;

  p {
    margin: 0;
    display: flex;
    justify-content: center;
    align-items: center;
  }
`;

const Card = () => (
  <Container>
    <Image>
      <p>imagem</p>
    </Image>
  </Container>
)

export default Card;
